  state = {
    urlLocation: '\\',
  }; // to handel fake url changes

  render() {
    return (
      <header className={styles.Toolbar}>
        <p> {window.location.href} </p>
        <h3></h3> TODO: Resume link TODO: Contact
      </header>
    );
  }
}

export default Toolbar;
